import React, { useState } from "react";
import StoreItem from "./StoreItem";
import Navbar from "./Navbar";

const Store = () => {
  const [stock, setStock] = useState({
    name: "",
    desc: "",
    price: 0,
    quantity: 0,
    img: "",
  });

  const mappedStock = stock.map((item) => {
    return (
      <StoreItem
        name={item.name}
        desc={item.desc}
        price={item.price}
        quantity={item.quantity}
        img={item.img}
      />
    );
  });

  return (
    <div className="store">
      <Navbar />
      <h1>Store</h1>
      <div>{/* {mappedStock} */}</div>
    </div>
  );
};

export default Store;
